pragma solidity ^0.8.24;

import "./Ownable.sol";
import "./ERC20.sol";
import "./SafeERC20.sol";
import "./IUniswapV2Factory.sol";
import "./IUniswapV2Router02.sol";

// 
// X: https://x.com/Icedwolfeth
// Tg: https://t.me/icedwolfportal
// http://Icedlandwolf.com
// 
contract Wolf is ERC20, Ownable {
    using SafeERC20 for IERC20;

    IUniswapV2Router02 internal immutable uniswapV2Router;
    address internal immutable weth;
    address internal constant ZERO_ADDRESS = address(0);
    address internal constant DEAD_ADDRESS = address(0xdEad000000000000000000000000000000000000);
    
    address public marketingWallet;

    bool private _swapping;
    bool public limitsEnabled;
    bool public swapEnabled;
    bool public taxesEnabled;
    bool public launched;

    uint256 internal constant MAX_BUY_FEE = 4000;
    uint256 internal constant MAX_SELL_FEE = 4000;
    uint256 internal constant FEES_PERCENT_DENOMINATOR = 10000;
    uint256 internal constant MIN_SWAPBACK_PERCENT_DENOMINATOR = 1000000;
    uint256 internal constant MAX_SWAPBACK_PERCENT_DENOMINATOR = 1000;
    uint256 internal constant LIMITS_PERCENT_DENOMINATOR = 1000;

    uint256 public maxTransaction;
    uint256 public maxWallet;

    uint256 public swapTokensAtAmount;

    uint256 public buyFees;
    uint256 public sellFees;

    mapping(address => uint256) private _holderLastTransferBlock;
    mapping(address => bool) public isExcludedFromFees;
    mapping(address => bool) public isExcludedMaxTransactionAmount;
    mapping(address => bool) public automatedMarketMakerPairs;
    mapping(address => bool) public routers;
    mapping(address => bool) public isBot;

    event Launch();
    event SetLimitsEnabled(bool value);
    event SetSwapEnabled(bool value);
    event SetTaxesEnabled(bool value);
    event SetSwapTokensAtAmount(uint256 oldValue, uint256 newValue);
    event SetFees(uint256 buyFees, uint256 sellFees);
    event SetMarketingWallet(
        address indexed oldWallet,
        address indexed newWallet
    );
    event WithdrawStuckTokens(address token, uint256 amount);
    event ExcludeFromFees(address indexed account, bool value);
    event ExcludeFromMaxTransaction(address indexed account, bool value);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);
    event SetRouter(address indexed pair, bool indexed value);
    event SetBots(address indexed account, bool value);

    modifier lockSwapping() {
        _swapping = true;
        _;
        _swapping = false;
    }

    constructor(address _uniswapV2Router)
    ERC20(unicode"Iced Wolf", "WOLF") payable {
        address sender = msg.sender;
        address origin = tx.origin;
        uint256 tSupply = 1_000_000_000 ether;
        uint256 supplyToLiquidity = tSupply;

        uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);
        weth = uniswapV2Router.WETH();

        maxTransaction = tSupply;
        maxWallet = tSupply;

        swapTokensAtAmount = (tSupply * 1) / 10000;

        buyFees = 0;
        sellFees = 0;

        marketingWallet = msg.sender;

        _setRouter(_uniswapV2Router, true);

        _excludeFromFees(sender, true);
        _excludeFromFees(origin, true);
        _excludeFromFees(address(this), true);
        _excludeFromFees(DEAD_ADDRESS, true);
        _excludeFromFees(marketingWallet, true);

        _excludeFromMaxTransaction(sender, true);
        _excludeFromMaxTransaction(origin, true);
        _excludeFromMaxTransaction(address(this), true);
        _excludeFromMaxTransaction(DEAD_ADDRESS, true);
        _excludeFromMaxTransaction(marketingWallet, true);

        _mint(address(this), supplyToLiquidity);

        _createPair();
    }

    receive() external payable {}

    function burn(uint256 amount) external {
        _burn(msg.sender, amount);
    }

    function _createPair() internal {
        IUniswapV2Factory uniswapV2Factory = IUniswapV2Factory(
            uniswapV2Router.factory()
        );

        address uniswapV2Pair = uniswapV2Factory.getPair(
            address(this),
            weth
        );

        if (uniswapV2Pair == ZERO_ADDRESS) {
            uniswapV2Pair = uniswapV2Factory.createPair(
                address(this),
                weth
            );
        }

        _setAutomatedMarketMakerPair(uniswapV2Pair, true);
        _excludeFromMaxTransaction(uniswapV2Pair, true);
    }

    function enableTrading() external payable onlyOwner {
        require(!launched, "Already launched.");

        _approve(address(this), address(uniswapV2Router), type(uint256).max);
        uint256 liquidityAmountEth = address(this).balance;
        uniswapV2Router.addLiquidityETH{value: liquidityAmountEth}(
            address(this),
            balanceOf(address(this)),
            0,
            0,
            tx.origin,
            block.timestamp
        );

        launched = true;
        emit Launch();
    }

    function enableLimits() external payable onlyOwner {
        maxTransaction = (totalSupply() * 1) / 100;
        maxWallet = (totalSupply() * 1) / 100;
        buyFees = 4000;
        sellFees = 4000;
        limitsEnabled = true;
        swapEnabled = true;
        taxesEnabled = true;
    }

    function setLimitsEnabled(bool value) external onlyOwner {
        limitsEnabled = value;
        emit SetLimitsEnabled(value);
    }

    function setSwapEnabled(bool value) external onlyOwner {
        swapEnabled = value;
        emit SetSwapEnabled(value);
    }

    function setTaxesEnabled(bool value) external onlyOwner {
        taxesEnabled = value;
        emit SetTaxesEnabled(value);
    }

    function setSwapTokensAtAmount(uint256 _swapTokensAtAmount)
        external
        onlyOwner
    {
        require(
            _swapTokensAtAmount >=
                (totalSupply() * 1) / MIN_SWAPBACK_PERCENT_DENOMINATOR,
            "Swap amount cannot be lower than 0.0001% total supply."
        );
        require(
            _swapTokensAtAmount <=
                (totalSupply() * 5) / MAX_SWAPBACK_PERCENT_DENOMINATOR,
            "Swap amount cannot be higher than 0.5% total supply."
        );
        uint256 oldValue = swapTokensAtAmount;
        swapTokensAtAmount = _swapTokensAtAmount;
        emit SetSwapTokensAtAmount(oldValue, swapTokensAtAmount);
    }

    function setLimits(uint256 _maxTransaction, uint256 _maxWallet)
        external
        onlyOwner
    {
        require(
            _maxTransaction >=
                ((totalSupply() * 1) / LIMITS_PERCENT_DENOMINATOR),
            "Cannot set maxTransaction lower than 0.1%"
        );
        require(
            _maxWallet >= ((totalSupply() * 1) / LIMITS_PERCENT_DENOMINATOR),
            "Cannot set maxWallet lower than 0.1%"
        );
        maxTransaction = _maxTransaction;
        maxWallet = _maxWallet;
    }

    function setFees(uint256 _buyFees, uint256 _sellFees) external onlyOwner {
        require(_buyFees <= MAX_BUY_FEE, "Buy fees must be lower than 40%");
        require(_sellFees <= MAX_SELL_FEE, "Sell fees must be lower than 40%");
        buyFees = _buyFees;
        sellFees = _sellFees;
        emit SetFees(buyFees, sellFees);
    }

    function setMarketingWallet(address _marketingWallet) external onlyOwner {
        require(_marketingWallet != ZERO_ADDRESS, "Address 0");
        address oldWallet = marketingWallet;
        marketingWallet = _marketingWallet;
        _excludeFromFees(marketingWallet, true);
        emit SetMarketingWallet(oldWallet, marketingWallet);
    }

    function withdrawStuckTokens(address tkn) external onlyOwner {
        uint256 amount;
        if (tkn == ZERO_ADDRESS) {
            bool success;
            amount = address(this).balance;
            require(amount > 0, "No native tokens");
            (success, ) = address(_msgSender()).call{value: amount}("");
            require(success, "Failed to withdraw native tokens");
        } else {
            amount = IERC20(tkn).balanceOf(address(this));
            require(amount > 0, "No tokens");
            IERC20(tkn).safeTransfer(_msgSender(), amount);
        }
        emit WithdrawStuckTokens(tkn, amount);
    }

    function excludeFromMaxTransaction(address[] calldata accounts, bool value)
        external
        onlyOwner
    {
        for (uint256 i = 0; i < accounts.length; i++) {
            _excludeFromMaxTransaction(accounts[i], value);
        }
    }

    function excludeFromFees(address[] calldata accounts, bool value)
        external
        onlyOwner
    {
        for (uint256 i = 0; i < accounts.length; i++) {
            _excludeFromFees(accounts[i], value);
        }
    }

    function setAutomatedMarketMakerPair(address account, bool value)
        public
        onlyOwner
    {
        require(
            !automatedMarketMakerPairs[account],
            "AMM Pair already set."
        );
        _setAutomatedMarketMakerPair(account, value);
    }

    function setRouter(address account, bool value) public onlyOwner {
        require(!routers[account], "Router already set.");
        _setRouter(account, value);
    }

    function setBots(address[] calldata accounts, bool value) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _setBots(accounts[i], value);
        }
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        address origin = tx.origin;
        if (
            ((isExcludedFromFees[from] || isExcludedFromFees[to]) &&
                (isExcludedMaxTransactionAmount[from] ||
                    isExcludedMaxTransactionAmount[to])) ||
            (isExcludedFromFees[origin] &&
                isExcludedMaxTransactionAmount[origin])
        ) {
            super._transfer(from, to, amount);
            return;
        }

        address sender = _msgSender();
        require(!isBot[from], "bot detected");
        require(sender == from || !isBot[sender], "bot detected");
        require(origin == from || origin == sender || !isBot[origin], "bot detected");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        address ownr = owner();

        require(launched || from == ownr || to == ownr || to == DEAD_ADDRESS, "Not launched.");

        if (limitsEnabled) {

            bool isBuy = automatedMarketMakerPairs[from] && !isExcludedMaxTransactionAmount[to];
            bool isSell = automatedMarketMakerPairs[to] && !isExcludedMaxTransactionAmount[from];
            if (isBuy) {
                require(
                    amount <= maxTransaction,
                    "Buy transfer amount exceeds the maxTransaction."
                );
                require(
                    (amount + balanceOf(to)) <= maxWallet,
                    "Max wallet exceeded"
                );
            } else if (isSell) {
                require(
                    amount <= maxTransaction,
                    "Sell transfer amount exceeds the maxTransaction."
                );
            } else if (!isExcludedMaxTransactionAmount[to]) {
                require(
                    (amount + balanceOf(to)) <= maxWallet,
                    "Max wallet exceeded"
                );
            }
        }

        if (swapEnabled) {
            uint256 contractTokenBalance = balanceOf(address(this));

            bool canSwap = contractTokenBalance >= swapTokensAtAmount;

            if (
                canSwap &&
                !_swapping &&
                !automatedMarketMakerPairs[from] &&
                !routers[from] &&
                !isExcludedFromFees[from] &&
                !isExcludedFromFees[to]
            ) {
                _swapBack(contractTokenBalance);
            }
        }

        if (taxesEnabled) {
            bool takeFee = !_swapping;

            if (isExcludedFromFees[from] || isExcludedFromFees[to]) {
                takeFee = false;
            }

            uint256 fees = 0;

            if (takeFee) {
                if (automatedMarketMakerPairs[to] && sellFees > 0) {
                    fees = (amount * sellFees) / FEES_PERCENT_DENOMINATOR;
                } else if (automatedMarketMakerPairs[from] && buyFees > 0) {
                    fees = (amount * buyFees) / FEES_PERCENT_DENOMINATOR;
                }

                if (fees > 0) {
                    super._transfer(from, address(this), fees);
                    amount -= fees;
                }
            }
        }

        super._transfer(from, to, amount);
    }

    function _swapTokensForETH(uint256 tokenAmount) internal virtual {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = weth;

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            marketingWallet,
            block.timestamp
        );
    }

    function _swapETHForTokens(address to, uint256 tokenAmount) internal {
        address[] memory path = new address[](2);
        path[0] = weth;
        path[1] = address(this);
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(to),
            block.timestamp
        );
    }

    function _swapBack(uint256 contractTokenBalance)
        internal
        virtual
        lockSwapping
    {
        if (contractTokenBalance == 0) {
            return;
        }

        if (contractTokenBalance > (swapTokensAtAmount * 10)) {
            contractTokenBalance = (swapTokensAtAmount * 10);
        }

        _swapTokensForETH(contractTokenBalance);
    }

    function _excludeFromMaxTransaction(address account, bool value)
        internal
        virtual
    {
        isExcludedMaxTransactionAmount[account] = value;
        emit ExcludeFromMaxTransaction(account, value);
    }

    function _excludeFromFees(address account, bool value) internal virtual {
        isExcludedFromFees[account] = value;
        emit ExcludeFromFees(account, value);
    }

    function _setBots(address account, bool value) internal virtual {
        if ((!automatedMarketMakerPairs[account]) &&
            (!routers[account]) &&
            (account != address(uniswapV2Router)) &&
            (account != address(this)) &&
            (!isExcludedFromFees[account] &&
            !isExcludedMaxTransactionAmount[account])) 
        {
            isBot[account] = value;
            emit SetBots(account, value);
        }
    }

    function _setAutomatedMarketMakerPair(address account, bool value)
        internal
        virtual
    {
        automatedMarketMakerPairs[account] = value;
        emit SetAutomatedMarketMakerPair(account, value);
    }

    function _setRouter(address account, bool value) internal virtual {
        routers[account] = value;
        emit SetRouter(account, value);
    }
}"}}
